import React from 'react';


const Activities =({imgsrc,description})=>{
    return(
      <div style={{
          margin:'3%',
          padding:'3%',
          width:'30%',
          height:'15%',
          position:'flex',
          background: 'white',
          borderRadius:'16px',
          boxShadow: '5px 10px 5px 5px gray'
      }}>
          <img src={imgsrc} style={{width:'25%',height:'25%'}}/>
          <h2>{{description}}</h2>
      </div>
    );
};
export default Activities;
